INSERT INTO `musico` (`idMusico`, `nombreArtistico`, `imagen`, `caracteristica`, `descripcion`) VALUES
('AV3NS', 'Avenged Sevenfold', , 'Grupo', 'Avenged Sevenfold es una banda de heavy metal estadounidense formada en 1999 en Huntington Beach, California. La banda está compuesta por M. Shadows, Synyster Gates, Zacky Vengeance, Johnny Christ y Brooks Wackerman.');
INSERT INTO `musico` (`idMusico`, `nombreArtistico`, `imagen`, `caracteristica`, `descripcion`) VALUES
('GRD4Y', 'Green Day', , 'Grupo', 'Green Day es una banda de punk rock estadounidense formada en 1986 en Berkeley, California. La banda está compuesta por Billie Joe Armstrong, Mike Dirnt y Tre Cool. Han sido una de las bandas más influyentes en la escena del punk rock desde los años 90.');
INSERT INTO `musico` (`idMusico`, `nombreArtistico`, `imagen`, `caracteristica`, `descripcion`) VALUES
('JD3NV', 'John Denver', , 'Solista', 'John Denver fue un cantante, compositor y músico estadounidense conocido por éxitos como \"Take Me Home, Country Roads\" y \"Annie\'s Song\". Nació el 31 de diciembre de 1943 y fue uno de los artistas más populares de la década de 1970.'),
('MJ4CK', 'Michael Jackson', , 'Solista', 'Michael Jackson, también conocido como el Rey del Pop, fue un cantante, compositor y bailarín estadounidense. Nacido el 29 de agosto de 1958, Jackson es una de las figuras más influyentes en la historia de la música pop.');
