INSERT INTO `podcast` (`idAudio`, `idPodcaster`, `colaboradores`, `descripcion`) VALUES
('BMPOD01', 'BM001', NULL, 'Episodio 1 de Black Mango, donde discutimos temas interesantes sobre la vida y la sociedad.'),
('BMPOD02', 'BM001', NULL, 'Episodio 2 de Black Mango, explorando nuevas ideas y perspectivas sobre diversos temas.'),
('BMPOD03', 'BM001', NULL, 'Episodio 3 de Black Mango, con invitados especiales compartiendo sus experiencias y opiniones.'),
('NEPOD01', 'NEPE4', NULL, 'Episodio 1 de Nepe, explorando la cultura pop y el entretenimiento con un toque de sarcasmo y humor.'),
('NEPOD02', 'NEPE4', NULL, 'Episodio 2 de Nepe, con análisis de películas, series de televisión y tendencias en las redes sociales.'),
('NEPOD03', 'NEPE4', NULL, 'Episodio 3 de Nepe, donde se comparten historias divertidas y anécdotas personales con los oyentes.'),
('NSNPOD01', 'NSN03', NULL, 'Episodio 1 de Nadie Sabe Nada, donde los comediantes improvisan sobre temas aleatorios sugeridos por la audiencia.'),
('NSNPOD02', 'NSN03', NULL, 'Episodio 2 de Nadie Sabe Nada, con humor inteligente y comentarios hilarantes sobre la vida cotidiana.'),
('NSNPOD03', 'NSN03', NULL, 'Episodio 3 de Nadie Sabe Nada, donde se discuten noticias curiosas y eventos inusuales.'),
('TWPOD01', 'TWP02', NULL, 'Episodio 1 de The Wild Project, explorando la naturaleza y la vida silvestre en todo el mundo.'),
('TWPOD02', 'TWP02', NULL, 'Episodio 2 de The Wild Project, con historias emocionantes de aventuras al aire libre.'),
('TWPOD03', 'TWP02', NULL, 'Episodio 3 de The Wild Project, con entrevistas a expertos en conservación y ecología.');
INSERT INTO `podcaster` (`idPodcaster`, `nombreArtistico`, `genero`, `imagen`, `descripcion`) VALUES
('BM001', 'Black Mango Podcast', 'Educación', , 'Un podcast que explora los rincones más oscuros y fascinantes de la cultura pop, desde conspiraciones hasta misterios inexplicables, todo con un toque de humor ácido y análisis profundo.');
INSERT INTO `podcaster` (`idPodcaster`, `nombreArtistico`, `genero`, `imagen`, `descripcion`) VALUES
('NEPE4', 'Nepe', 'Educación', , '¿Estás listo para reír hasta llorar? Nepe es el podcast de comedia que te hará perder el aliento con sus sketches hilarantes, monólogos ingeniosos y entrevistas con invitados famosos que revelan su lado más divertido y peculiar.');
INSERT INTO `podcaster` (`idPodcaster`, `nombreArtistico`, `genero`, `imagen`, `descripcion`) VALUES
('NSN03', 'Nadie Sabe Nada', 'Humor', , 'Un podcast improvisado donde dos comediantes geniales, sin guion ni preparación previa, se sumergen en conversaciones hilarantes y absurdas sobre temas aleatorios, garantizando risas sin parar y momentos de puro entretenimiento.');
INSERT INTO `podcaster` (`idPodcaster`, `nombreArtistico`, `genero`, `imagen`, `descripcion`) VALUES
('TWP02', 'The Wild Project', 'Sociedad', , 'Sumérgete en la naturaleza salvaje con The Wild Project, donde cada episodio te transporta a un nuevo destino remoto, explorando la vida silvestre, la conservación ambiental y las aventuras al aire libre más emocionantes.');
