CREATE DEFINER=`root`@`localhost` PROCEDURE `CancionesFavoritas` ()   BEGIN
DECLARE nomCancion varchar(100);
DECLARE dur varchar(50);
DECLARE artInvitado varchar(50);
DECLARE cantReproducciones int;

DECLARE contador int DEFAULT 1;
DECLARE fin boolean DEFAULT 0;

DECLARE topCanciones CURSOR FOR 
Select au.nombre 'Canción', au.duracion 'Duración (min)', can.artistaInvitado 'Artista Invitado', est.reproducciones 'Reproducciones'
from audio as au join cancion as can on au.idAudio = can.idCancion join estadisticas as est on au.idAudio = est.idAudio
order by reproducciones desc;

DECLARE CONTINUE HANDLER FOR NOT FOUND SET fin = 1;

DROP TABLE IF EXISTS top10CancionesFavoritas;
CREATE TABLE top10CancionesFavoritas(
nombreCancion varchar(100),
durCancion varchar(50),
artistaInvitado varchar(50),
Reproducciones int
);

OPEN topCanciones;
FETCH topCanciones INTO nomCancion, dur, artInvitado, cantReproducciones;

WHILE contador <=10 DO
IF fin = 0 THEN 
FETCH topCanciones INTO nomCancion, dur, artInvitado, cantReproducciones;
SET contador = contador + 1;

ELSE
SELECT CONCAT ("No hay canciones suficientes en las estadísticas para hacer un  top 10") "Canciones insuficientes para top 10";

END IF;
END WHILE;
SELECT * FROM top10CancionesFavoritas;
CLOSE topCanciones;
END$$

